import ReactDom from 'react-dom'

// stateless functional component (must captialize the first character)
function App() {
  // return JSX/Html
  return (
    <React.Fragment>
      <h4>Title</h4>
      <Item />
    </React.Fragment>
  );
}

const Item = () => {
  return (
    <React.Fragment>
      <article>
        Iron
      </article>
      <ItemImage></ItemImage>
    </React.Fragment>
  )
}

const ItemImage = () => {
  return (
    <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fstatic.wikia.nocookie.net%2Fminecraft%2Fimages%2Fe%2Fe8%2FNew_Iron_IngotB.png%2Frevision%2Flatest%3Fcb%3D20190520101024&imgrefurl=https%3A%2F%2Fminecraft-archive.fandom.com%2Fwiki%2FIron_Ingot&tbnid=SaO32c-DWKJoWM&vet=12ahUKEwiX4J-Sz_HwAhUJhpQKHSBOCboQMygBegUIARC1AQ..i&docid=YohLw224korXeM&w=160&h=160&q=iron%20minecraft%20wiki&hl=en&ved=2ahUKEwiX4J-Sz_HwAhUJhpQKHSBOCboQMygBegUIARC1AQ" alt=""/>
  )
}
ReactDom.render(<App/>, document.getElementById('root'));
